import React from "react";
import styled from "styled-components";
import {useNavigate} from "react-router-dom";
import About from "../imgs/About.png";
import carina from "../imgs/carina.jpg";
import jijele from "../imgs/jijele.jpeg";

const AboutPage = () => {
    const navigate = useNavigate();

    const Detailbutton = () => {
        navigate("/");
    }
    return (
        <Container>
        <BigAboutContainer>
            <AboutContainer>
                <TopAboutContainer>
                    <ImageContainer>
                        <img src={About} alt="About Image" />
                        <OverlayTextContainer>
                            <OverlayTextTop>
                                <h2>한소연이란 무엇입니까?</h2>
                            </OverlayTextTop>
                            <OverlayTextBottom>
                                <h2>About</h2>
                            </OverlayTextBottom>
                        </OverlayTextContainer>
                    </ImageContainer>
                </TopAboutContainer>
                <BottomAboutContainer>
                    <BottomCenterContainer>
                        <h2>우리의 생각</h2>
                        <h3>한국에는 아직 놀라울 정도로 넘치는 지역으로 가득합니다.</h3>
                        <h3>더 많은 사람들이 한국 각지에 부담없이 나가서 지역 각지에서 즐기는 세상을 만들고 싶습니다!</h3>
                        <h3>"한소연"은 그런 생각에서 태어난 서비스 입니다.</h3>
                        <DeatailButton onClick={Detailbutton}>자세히 보기</DeatailButton>
                    </BottomCenterContainer>
                </BottomAboutContainer>
            </AboutContainer>
        </BigAboutContainer>
            <FeatureContainer>
                {/*<h2>매일의 특징</h2>*/}
                <BigFeatureContainer>
                    <FirstFeatureContainer>
                        <img src={About} alt="About Image" />
                    </FirstFeatureContainer>
                    <FirstFeatureContainer>
                        <img src={carina} alt="Carina Image" />
                    </FirstFeatureContainer>
                    <FirstFeatureContainer>
                        <img src={jijele} alt="Jiejele Image" />
                    </FirstFeatureContainer>
                </BigFeatureContainer>
            </FeatureContainer>
        </Container>
    )
}
const Container = styled.div`
  position: absolute;
  width: 100%;
  height: 100vh;
  margin: auto;
`
const BigAboutContainer = styled.div`
  display: flex;
  flex: 1;
  height: 700px;
  justify-content: center;
  align-items: center;
  margin-top: 8rem;
  border-radius: 20% 20% 0 0 / 20% 20% 0 0; /* 부드러운 흐물한 효과를 위한 border-radius 설정 */
  background-color: #F0CDA0;
`
const AboutContainer = styled.div`
  display: flex;
  width: 1200px;
  flex-direction: column;
  height: 600px;
`

const TopAboutContainer = styled.div`
  display: flex;
  flex: 5.5;
`

const ImageContainer = styled.div`
  display: flex;
  position: relative;
  flex: 1;
  justify-content: center;
  align-items: center;

img {
  width: 90%;
  height: 350px;
}

`
const OverlayTextContainer = styled.div`
  position: absolute;
  justify-content: center;
  width: 100%;
  height: 200px;
  display: flex;
  flex-direction: column;
  padding: 20px;
`;

const OverlayTextTop = styled.div`
  border-radius: 5px;
  text-align: center;

  h2 {
    font-size: 32px;
    font-weight: 700;
    color: white;
  }
`;

const OverlayTextBottom = styled.div`
  border-radius: 5px;
  text-align: center;

  h2 {
    font-size: 28px;
    font-weight: 600;
    color: white;
  }
`;

const BottomAboutContainer = styled.div`
  display: flex;
  flex: 4.5;
  flex-direction: column;
  justify-content: center;
`
const BottomCenterContainer = styled.div`
  display: flex;
  flex: 1;
  background-color: #FDF9EA;
  flex-direction: column;
  justify-content: center;
  align-items: center;

  h2 {
    font-size: 36px;
    color: orange;
    font-weight: 700;
  }
  h3 {
    font-size: 28px;
    font-weight: 600;
  }
`
const DeatailButton = styled.button`
  background-color: #EF6C00;
  color: white;
  font-weight: 500;
  border: none;
  border-radius: 3px;
  width: 250px;
  height: 35px;
`

const FeatureContainer = styled.div`
  background-color: green;
  margin-top: 4rem;
  display: flex;
  width: 100%;
  height: 350px;
  justify-content: space-around; /* 가로 방향 중앙 정렬 */
  padding: 0 12rem; /* 왼쪽과 오른쪽에 좀 더 간격을 주기 위해 padding 추가 */
`
const BigFeatureContainer = styled.div`
  background-color: yellow;
  width: 1200px;
  margin: auto;
  justify-content: center;
  display: flex;
  flex-direction: row;
  height: 300px;
`
const FirstFeatureContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  background-color: red;
  width: 20rem;
  border-radius: 8px;
  text-align: center;

  margin: 1rem;
  img {
    margin-top: 1rem;
    width: 15rem;
    height: 10rem;
    border-radius: 5rem;
  }

`
export default AboutPage;
